  false,\n\t\"url\": null,\n\t\"notes\": \"The purpose of the Walnut Creek National
  Wildlife Refuge (now Neal Smith National Wildlife Refuge) Master Plan is to guide
  the long-range development of the Refuge, by identifying and integrating appropriate
  habitats, management strategies, program elements, and facilities which support
  the goals and objectives for which the Refuge was established. The Master Plan is
  based on a 10-year time frame and should be evaluated for modification every five
  years.  Five goals and supporting objectives are established for the Refuge in this
  document, addressing the following major Refuge purposes: biodiversity preservation,
  environmental protection, environmental education, research, and interpretation
  and recreation.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
